import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

// Routing
import PrivateRoute from "./components/routing/PrivateRoute";

// Screens
import PrivateScreen from "./components/screens/PrivateScreen";
import LoginScreen from "./components/screens/LoginScreen";
import AddAccountScreen from "./components/screens/AddAccountScreen";
import ForgotPasswordScreen from "./components/screens/ForgotPasswordScreen";
import ResetPasswordScreen from "./components/screens/ResetPasswordScreen";
import ListUser from "./components/screens/LstUser";
import Main from "./components/routing/Main"
import Header from "./components/routing/Header"


const App = () => {
  return (
    <Router>

      <div className="app">

        <Switch>
          <PrivateRoute exact path="/admin" component={PrivateScreen} />
          <Route exact path="/login" component={LoginScreen} />   
          <Route exact render={(props) => <Header />} />      
          <Route exact path="/" exact render={(props) => <Main />} />
          <Route exact path="/addAccount" component={AddAccountScreen} />

        </Switch>

      </div>
    </Router>

  );
};

export default App;
